import { motion } from "framer-motion";

const Skills = () => {
  const codingSkills = [
    { name: "HTML/CSS", level: 90 },
    { name: "JavaScript", level: 60 },
    { name: "Bootstrap", level: 60 },
    { name: "JAVA", level: 80 },
    { name: "PHP", level: 70 },
    { name: "MySQL", level: 90 }
  ];

  const professionalSkills = [
    { name: "Frontend Development", level: 90 },
    { name: "Quality Testing", level: 80 },
    { name: "Marketing", level: 80 },
    { name: "Business analysis", level: 70 },
    { name: "Project Management", level: 70 },
    { name: "Content Creation", level: 95 }
  ];

  const SkillBar = ({ skill, index }) => (
    <motion.div
      className="mb-7"
      initial={{ opacity: 0, x: -20 }}
      whileInView={{ opacity: 1, x: 0 }}
      viewport={{ once: true }}
      transition={{ duration: 0.5, delay: index * 0.1 }}
    >
      <div className="flex justify-between items-center mb-3">
        <span className="text-gray-200 font-medium text-base">{skill.name}</span>
        <span className="text-blue-400 font-bold text-base">{skill.level}%</span>
      </div>
      <div className="h-2.5 bg-gray-700 rounded-full overflow-hidden relative">
        <motion.div
          className="h-full bg-blue-500 rounded-full absolute top-0 left-0"
          initial={{ width: 0 }}
          whileInView={{ width: `${skill.level}%` }}
          viewport={{ once: true }}
          transition={{ duration: 1.2, delay: index * 0.1 + 0.3, ease: "easeOut" }}
        />
      </div>
    </motion.div>
  );

  return (
    <section id="skills" className="py-24 bg-gradient-to-b from-[#0f172a] to-[#1e293b]">
      <div className="mx-auto max-w-7xl px-6 lg:px-8">
        {/* Header */}
        <motion.div
          className="mb-20 text-center"
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true }}
          transition={{ duration: 0.6 }}
        >
          <p className="text-blue-400 text-sm md:text-base uppercase tracking-widest mb-4 font-medium">
            Introduction
          </p>
          <div className="relative inline-block">
            <h2 className="text-4xl md:text-5xl lg:text-6xl font-bold text-white mb-3">
              My Skills
            </h2>
            <div className="absolute bottom-0 left-1/2 transform -translate-x-1/2 w-32 h-1 bg-blue-500"></div>
          </div>
        </motion.div>

        {/* Skills Grid */}
        <div className="grid md:grid-cols-2 gap-10 lg:gap-16 max-w-6xl mx-auto">
          {/* Coding Skills */}
          <motion.div
            className="bg-[#1e293b]/60 backdrop-blur-sm p-10 rounded-2xl shadow-xl border border-gray-700/50"
            initial={{ opacity: 0, x: -50 }}
            whileInView={{ opacity: 1, x: 0 }}
            viewport={{ once: true }}
            transition={{ duration: 0.7 }}
          >
            <h3 className="text-2xl md:text-3xl font-bold text-white mb-10">
              Coding Skills
            </h3>
            <div>
              {codingSkills.map((skill, index) => (
                <SkillBar key={skill.name} skill={skill} index={index} />
              ))}
            </div>
          </motion.div>

          {/* Professional Skills */}
          <motion.div
            className="bg-[#1e293b]/60 backdrop-blur-sm p-10 rounded-2xl shadow-xl border border-gray-700/50"
            initial={{ opacity: 0, x: 50 }}
            whileInView={{ opacity: 1, x: 0 }}
            viewport={{ once: true }}
            transition={{ duration: 0.7, delay: 0.2 }}
          >
            <h3 className="text-2xl md:text-3xl font-bold text-white mb-10">
              Professional Skills
            </h3>
            <div>
              {professionalSkills.map((skill, index) => (
                <SkillBar key={skill.name} skill={skill} index={index} />
              ))}
            </div>
          </motion.div>
        </div>
      </div>
    </section>
  );
};

export default Skills;
